import styles from './SearchOpponentScreen.module.scss'

export const SearchOpponentScreen = () => {
	return (
		<div className={ styles.SearchOpponent }>
			<div className={ styles.wrapper }>
				<input
					type="text"
					placeholder="Username"
					autoFocus={ true }
				/>
			</div>
		</div>
	)
}
